const Overview = props => (
  <div>
    <p>
      Letter writing is <i>optional</i> on your exam and you can instead choose
      to write a <a href="/topics/composition">Composition</a>. However, if you
      choose to do this question is is important to know what is required and
      how your letter is to be structured.
    </p>
  </div>
);

export default Overview;
